export declare const databaseExtension = "\nFunction DatabaseExstension(nameDatabase)\n    dim ext\n    ext = \"NONE\"\n    If Right(UCase(nameDatabase), 4) = \".MDB\" then\n        ext = \"MDB\"\n    End If\n    If Right(UCase(nameDatabase), 6) = \".ACCDB\" then\n        ext = \"ACCDB\"\n    End If\n    DatabaseExstension = ext\nEnd Function";
